        public static void SaveByteArrayToFileWithFileStream(byte[] data, string filePath)
        {
            using (var filestream = File.OpenWrite(filePath))
            {
                BinaryWriter bw = new BinaryWriter(filestream);
                bw.Write(data, 0, (int)data.Length);
                bw.Close();
            }
        }

        public static void Print(string printerName, string fileName)
        {
            //fileName = @"E:\bill_letter.pdf";
            try
            {
                ProcessStartInfo gsProcessInfo;
                Process gsProcess;
                //printerName = "OneNote for Windows 10";

                gsProcessInfo = new ProcessStartInfo();
                gsProcessInfo.Verb = "PrintTo";
                gsProcessInfo.WindowStyle = ProcessWindowStyle.Hidden;
                gsProcessInfo.FileName = fileName.Trim();
                gsProcessInfo.Arguments = "\"" + printerName + "\"";
                
                gsProcess = Process.Start(gsProcessInfo);

                gsProcess.EnableRaisingEvents = true;
                
                gsProcess.Close();
            }
            catch (Exception ex)
            {
                Console.WriteLine(ex);
            }
        }
